import style from "./Menu.module.css";

function Menu(props) {
  return (
    <>
      <input class="nav__checkbox" id="nav__toggle" type="checkbox" />

      <label class="nav__menu" for="nav__toggle" id="toggle-button">
        <span class="nav__menu__icon"></span>
      </label>
    </>
  );
}

export default Menu;
